import "./App.css";
import Menu from "./components/Menu";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Container from "react-bootstrap/Container";

function App() {
  return (
    <Router>
      <div className="App">
        <Container>
          <Switch>
            <Route path="/about"></Route>
            <Route path="/users"></Route>
            <Route path="/">
              <Menu></Menu>
            </Route>
          </Switch>
        </Container>
      </div>
    </Router>
  );
}

export default App;
